import React, { Component } from 'react';
import Button from '@material-ui/core/Button';

import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
            #Which Celeb Is You?
          </p>
          <Button variant="contained" color="primary">
            Start Test
          </Button>
        </header>
      </div>
    );
  }
}

